import React from 'react';
import styled from 'styled-components';
import FrameworkWheel from './components/FrameworkWheel';
import DetailPanel from './components/DetailPanel';

const AppContainer = styled.div`
  max-width: 1200px;
  margin: 0 auto;
  padding: 20px;
  font-family: 'Arial', sans-serif;
`;

const Header = styled.header`
  text-align: center;
  margin-bottom: 40px;
`;

const Title = styled.h1`
  color: #2c3e50;
  font-size: 2.5em;
`;

const Subtitle = styled.h2`
  color: #7f8c8d;
  font-size: 1.5em;
`;

function App() {
  const [selectedComponent, setSelectedComponent] = React.useState(null);

  return (
    <AppContainer>
      <Header>
        <Title>T.R.A.C.E</Title>
        <Subtitle>The Intelligence Framework</Subtitle>
      </Header>
      <FrameworkWheel onComponentSelect={setSelectedComponent} />
      <DetailPanel selectedComponent={selectedComponent} />
    </AppContainer>
  );
}

export default App;
